            }

            
            let writeReturn = { uniffiOutReturn.pointee = FfiConverterTypeRouteDeviation_lower($0) }
            uniffiTraitInterfaceCall(
                callStatus: uniffiCallStatus,
                makeCall: makeCall,
                writeReturn: writeReturn
